import './App.css';
import {Aterrizaje,Login,NotFound, Registrarse, VerUsuarios} from './Paginas/index'
import {Routes, Route} from 'react-router-dom'
function App() {
  return (
    <>

    <div className='bg-neutral-900 min-h-screen flex items-center'>
      <div className='px-10 container m-auto bg-red-100'>
        <h1>ESTA ES LA CABECERA</h1>

      <Routes>
        <Route path='/' element={<Aterrizaje/>}></Route>
        <Route path='/login' element={<Login/>}></Route>
        <Route path='/signup' element={<Registrarse/>}></Route>
        <Route path='/admin/seeusers' element={<VerUsuarios/>}></Route>
        <Route path='*' element={<NotFound/>}></Route>
      </Routes>
      </div>

    </div>
    <div className='bg-red text-light'><h1>Y ESTE ES EL FOOTER</h1></div>
    </>
  );
}

export default App;
